function doSum(n) {
	if (n.length <= 1) return n;

	let result = BigInt(0);
	for (let i = 0; i < n.length; i++) {
		result += BigInt(parseInt(n[i]));
	}
	return doSum(result.toString());
}

function superDigit(n, k) {
	let numStr = '';
	for(let i = 0; i < k; i++) {
		numStr += n.toString();
	}

	return doSum(numStr);
}

